import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    margin-left: 25px;
    height: 56px;
    background-color: #FFFFFF;
`;
export const MenuIconMaterial = styled.div`
    cursor: pointer;
`;
export const MenuIconYoutube = styled.div`
    cursor: pointer;
`;
export const YoutubeImage = styled.img`
    width: 92px;

`;
export const DivInput = styled.div`
    display: flex;
    align-items: center;
    margin-left: 145px;

`;
export const Input = styled.input`
    width: 574px;
    height: 29px;
    font-size: 16px;
    padding-left: 6px;
    border: 1px solid #CCC;


`;
export const DivIconSeach = styled.div`
    margin-left: 22px;
    margin-top: 6px;
    cursor: pointer;
`;
export const IconeSearch = styled.div`
    border: 1px solid #CCC;
    width: 70px;
    height: 32px;
    background-color: #EAEAEA;
    color: #000000;
    cursor: pointer;

    &:hover{
        background-color: #CCC;
    }
`;

export const DivCamera = styled.div`
    margin-left: 123px;
    cursor: pointer;
`;

export const DivApp = styled.div`
    cursor: pointer;
`;
export const DivNotification = styled.div`
    cursor: pointer;
`;
export const DivAccount = styled.div`
    cursor: pointer;
`;
